import React from 'react'

const ItemList = ({ productos, cargando }) => {
    return (
      <>
        {productos.length > 0 ? (
          productos.map((producto, index) => {
            <>
              <h1>{producto.Nombre}</h1>
            </>;
          })
        ) : (
          <h1>{cargando}</h1>
        )}
      </>
    );
        }
  
export default ItemList
